import React, { useEffect, useState } from "react";

const Price = () => {

    const [isLoader, setLoader] = useState(true);
    useEffect(() => {
        setTimeout(() => {
            setLoader(false)
        }, 2000)
    })

  return (
    <>
      {isLoader ?
                <><Loader />
                </> : <>
                    <HeadSwiper />
                    <AboutWe />
                    <Feedback />
                    <Footer />
                </>}
    </>
  );
};

export default Price;
